import React, { Component } from 'react';
import './about.css'
import twitter from '../images/twitterImg.jpg'
class about extends Component {
    state = {  }
    
    render() { 
        return (<div>
            <h1 style={{"text-decoration": "underline"}}>About</h1>
            <p style={{"text-align":"center"}}><strong>Built using TRN Tracker API:</strong> <a href="https://tracker.gg/">TRN TRACKER </a> </p>
            <div className="social-links">
            <img src={twitter}></img>
            <img src="https://cdns.iconmonstr.com/wp-content/assets/preview/2012/240/iconmonstr-twitter-1.png"></img>
            <img src=""></img>
            </div>
        </div>  );
    }
}
 
export default about;
